import React from "react";
import "./style.css";
import { url } from "inspector";

function Jumbotron({ children }) {
  return (
    <div
      style={{
        height: 300, clear: "both", paddingTop: 60, margin: 20, textAlign: "center", color: "blue", border: 2, "solid": "black",
        backgroundImage: url("http://www.francescomptonlibrary.com/uploads/5/2/1/5/52157523/7851018.jpg?257")

      }}
      className="jumbotron"
    >
      {children}
    </div >
  );
}

export default Jumbotron;
